import back_image from '../images/img_background.jpg';
import './header.css';

export default function create_header() {
    return (
        <div className="header" style={{ backgroundAttachment: 'scroll' }}>
            <img src={back_image} alt="back" className="header-image" />
            <h1 className="header-title">水瀬いのり セッション会</h1>
        </div>
    );
}
